      "Dusun Karampuang 2":
        "Dusun Karampuang 2 atau biasa dikenal juga dengan Dusun Bone Langka adalah dusun yang terletak di sisi barat Pulau Karampuang. Dusun ini terletak tepat diatas Dusun Karampuang 1. Penduduk laki-laki di dusun ini mencapai 160 jiwa sementara penduduk perempuan mencapai 157 jiwa. Seluruh penduduk tersebut terangkum pada 94 KK yang dipimpin oleh laki-laki dan 21 KK yang dipimpin oleh perempuan. Penduduk dusun ini mayoritas memiliki pekerjaan sebagai nelayan, diikuti dengan pekerjaan sebagai petani, pedagang/wiraswasta, pegawai swasta, dan PNS.",
